import React from "react";

function Parrafo() {
  return (
    <p className="lead text-center text-secondary mb-5">
      Únete a nuestro club de artes marciales y transforma tu vida.
      Aquí no solo aprenderás técnicas de defensa personal, sino también
      disciplina, respeto, autocontrol y confianza.
      Te ayudaremos a crecer como artista marcial y como ser humano.
    </p>
  );
}

export default Parrafo;
